import Button from "./Button";

function Header(props) {
    return (
        <header className='header'>
            <h1>Task Tracker</h1>
            <Button color='black' text='Add' />
        </header>
    );
}

Button.defaultProps = {
    color: 'steelblue'
}

Button.propTypes = {
    text: PropTypes.string,
    color: PropTypes.string
}


export default Header;
